"css" : "
<meta http-equiv="Content-Type" content="text/html; charset=utf-8"/>
<style type="text/css">
table {
 border-spacing: 0px;
}
.main-table {
 border: 1px #fd8900 solid;
 table-layout: fixed;
}
.table-data-container-container {
 padding: 0px;
}
.table-data {
 width: 100%;
 table-layout:fixed;
}
.column_heading {
 display: block;
 padding-right: 3em;
}
th {
 background-color: #fff300;
 color: #fd8900;
 white-space: pre-wrap;
 font-weight: bold;
 text-align: left;
 position: relative;
 height: 58px; /* height actually behaves as a min-height */
}
a:link, a:visited {
 color: #fd8900;
}
a:hover, a:active {
 color: #886600;
}
a.sort_column, a.sort_column:link, a.sort_column:visited {
 color: #553300;
 display:inline;
}
a.filtered_column_label {
 font-style: italic;
}
a.filter_icon, a.filter_icon:link, a.filter_icon:visited {
 color: #fd8900;
 display:inline;
 text-decoration:none;
 font-size: 3em;
 padding-right: 8px;
}
th, .table-data tr td {
 border-right: 1px #fd8900 solid;
 padding-left: 5px;
 padding-right: 5px;
}
td.pass {
 font-weight:bold;
}
td.fail { 
 font-weight:bold;
}
td.slow {
 font-weight:bold;
}
</style>"

